import PropTypes from "prop-types";
import React, { useReducer } from "react";

export const Component = ({ property1, className, pullDataClassName }) => {
  const [state, dispatch] = useReducer(reducer, {
    property1: property1 || "group-30",
  });

  return (
    <div
      className={`${state.property1 === "group-30" ? "border border-solid" : ""} ${
        state.property1 === "group-30" ? "border-black" : ""
      } ${"w-[122px] h-[47px]"} ${state.property1 === "group-30" ? "rounded-[23.5px]" : ""} ${
        state.property1 === "group-30" ? "bg-black" : ""
      } ${state.property1 === "group-30" ? "relative" : ""} ${className}`}
      onMouseLeave={() => {
        dispatch("mouse_leave");
      }}
      onMouseEnter={() => {
        dispatch("mouse_enter");
      }}
    >
      {/* Pull Data Button */}
      <div
        className={`w-[122px] h-[47px] ${state.property1 === "group-30" ? "[font-family:'Poppins',Helvetica]" : ""} ${
          state.property1 === "group-30" ? "text-white" : ""
        } ${state.property1 === "group-30" ? "text-xs" : ""} ${
          state.property1 === "group-30" ? "font-semibold" : ""
        } ${state.property1 === "group-30" ? "text-center" : ""} ${
          state.property1 === "group-30" ? "leading-[normal]" : ""
        } ${pullDataClassName}`}
      >
        Pull Data
      </div>

      {/* Tooltip Section */}
      {state.property1 === "group-1410082888" && (
        <>
          {/* Tooltip Box */}
          <div className="absolute top-12 left-1/2 transform -translate-x-1/2 mt-2 bg-gray-700 text-white text-xs rounded-lg px-4 py-2 z-50">
            Pull your data from AppFolio
            <div className="absolute w-3 h-3 bg-gray-700 -top-1 left-1/2 transform -translate-x-1/2 rotate-45"></div>
          </div>
        </>
      )}
    </div>
  );
};

function reducer(state, action) {
  switch (action) {
    case "mouse_enter":
      return {
        ...state,
        property1: "group-1410082888",
      };

    case "mouse_leave":
      return {
        ...state,
        property1: "group-30",
      };
    default:
      return state;
  }
}

Component.propTypes = {
  property1: PropTypes.oneOf(["group-30", "group-1410082888"]),
};
